$(function () {
    $('#submit-btn').click(function (event) {
        event.preventDefault();

        var telephoneE = $("input[name='telephone']");
        var smsCaptchaE = $("input[name='sms_captcha']");
        var usernameE = $("input[name='username']");
        var password1E = $("input[name='password1']");
        var password2E = $("input[name='password2']");
        var imgCaptchaE = $("input[name='img_captcha']");

        var telephone = telephoneE.val();
        var sms_captcha = smsCaptchaE.val();
        var username = usernameE.val();
        var password1 = password1E.val();
        var password2 = password2E.val();
        var img_captcha = imgCaptchaE.val();

        bbsajax.post({
            'url':'/signup/',
            'data':{
                'telephone':telephone,
                'sms_captcha':sms_captcha,
                'username':username,
                'password1':password1,
                'password2':password2,
                'img_captcha':img_captcha
            },
            'success':function (result) {
                console.log(result);
                if(result['code'] == 200){
                    var return_to = $('#return-to-span').text();
                    if(return_to){
                        window.location = return_to;
                    }else{
                        window.location = '/';
                    }
                }else{
                    bbsalert.alertInfo(result['message']);
                }
            },
            'fail':function () {
                bbsalert.alertNetworkError();
            }
        });
    });
})